import { Container } from "./AddRegister";

export default function AddRegister(){
    return(
        <Container>
            <h1>Nova Saída</h1>
            <form action="">
                <input type="number" placeholder="Valor" />
                <input type="text" placeholder="Descrição" />
                <button type="submit">Salvar saída</button>
            </form>
        </Container>
    );
}
